;; **
;;; ## Statistics
;; **

;; @@
(table/table-view 
  (map 
    (fn [[k v]] 
      (concat [(element-name k)] (format-to-table-view v))) 
    (zipmap (vals broadcasters) (map #(temporal-distance % t0 tmax :statistics) (keys broadcasters)))) 
  :columns table-columns)
